></span></del> <ins><span class=\\\"woocommerce-Price-amount amount\\\"><bdi><span class=\\\"woocommerce-Price-currencySymbol\\\">&euro;</span>29.96</bdi></span></ins>\", \"sale_price\": \"\", \"tax_status\": \"taxable\", \"upsell_ids\": [], \"variations\": [90014, 89935, 89936, 89937, 89938, 89939, 89940, 89941, 89942, 89943, 89944, 89945, 89946, 89947, 89948, 89949, 89950, 89951, 89952, 89953, 89954, 89955, 89956, 89957, 89958, 89959, 89960, 89961, 89962, 89963, 89964, 89965, 89966, 89967, 89968, 89969, 89970, 89971, 89972, 89973, 89974, 89975, 89976, 89977, 89978, 89979, 89980, 89981, 89982, 89983, 89984, 89985, 89986, 89987, 89988, 89989, 89990, 89991, 89992, 89993, 89994, 89995, 89996, 89997, 89998, 89999, 90000, 90001, 90002, 90003, 90004, 90005, 90006, 90007, 90008, 90009, 90010, 90011, 90012, 90013], \"backordered\": false, \"button_text\": \"\", \"description\": \"<h2 style=\\\"text-align: center;\\\"><strong>No more irritating bunion pain and discomfort! Ease the pain without surgery and enjoy long walks with your perfect Orthopedic Bunion Correction Sandals!</strong></h2>\\n<p><img class=\\\"size-full wp-image-90043 aligncenter\\\" src=\\\"https://example.org/wp-content/uploads/2020/09/b887f47d74087b8eff201d99d89e5f72.gif\\\" alt=\\\"\\\" width=\\\"580\\\" height=\\\"425\\\" /></p>\\n<p>These Orthopedic Bunion Correction Sandals featuring a stylish toe-ring design are specially developed with a three arch support and a soft sole to keep your feet comfortable, healthy, and safe. The special big toe design effectively <strong>relieves bunion pain, improves foot posture, and moves the angled toe bone back to its natural position</strong> while realigning the skeletal system for posture correction. A weak imbalance can lead to pains in the knees, hips, and other muscles of your body. The orthopedic sandals help prevent hips and muscle imbalances, knock-knee and bow-leg, and other future toe complications.</p>\\n<p><img class=\\\"size-full wp-image-90039 aligncenter\\\" src=\\\"https://example.org/wp-content/uploads/2020/09/1-10.jpg\\\" alt=\\\"\\\" width=\\\"480\\\" height=\\\"411\\\" /></p>\\n<p><strong>Three arch support design</strong> makes sure your weight is evenly distributed across the toes, arch, and ball of your feet. One of the most innovative techniques used in this pair of sandals is the sole made by <strong>nano-foam</strong> - the <strong>next generation of memory soles</strong> that will <strong>transform to fit and comfortably hug</strong> your feet, where ever you go. The perfect combination of toe bunion corrector with flip flop wedge sandals allows you to hide your bunions in style while preventing toe overlap and poor bunion alignment. They are ideal for women suffering from bunions, flat feet, poor walking posture, and plantar fasciitis.</p>\\n<p><img class=\\\"size-full wp-image-90026 aligncenter\\\" src=\\\"https://example.org/wp-content/uploads/2020/09/19088f2b63cc5a60ef440dea27b96854.gif\\\" alt=\\\"\\\" width=\\\"590\\\" height=\\\"564\\\" /></p>\\n<p style=\\\"text-align: center;\\\"><strong>KEY BENEFITS</strong></p>\\n<p class=\\\"p1\\\">✔️ <strong>PAIN RELIEF</strong> — Eliminate the pain caused by bunions, flat feet, poor walking posture, and plantar fasciitis.</p>\\n<p class=\\\"p1\\\">✔️ <strong>ANTI BUNION DESIGN</strong> — Special big toe strap relieves bunion pain, helps correct and realign them, and prevents bunions from forming.</p>\\n<p class=\\\"p1\\\">✔️ <strong>POSTURE CORRECTION</strong> — Moves angled toe back to its natural position while realigning skeletal system for posture correction. It prevents hip and muscle imbalances and fixes knock-knee and bow-leg.</p>\\n<p class=\\\"p1\\\">✔️ <strong>THREE ARCH SUPPORT</strong> — Evenly distribute the weight across the toes, arch, and ball of your feet, making them feel more comfortable and steady.</p>\\n<p class=\\\"p1\\\">✔️ <strong>SUPER COMFORTABLE</strong> — Provide ultimate comfort even while wearing all day long; they won\'t hurt your feet, toes, or ankles.</p>\\n<p style=\\\"text-align: center;\\\"><strong>SIZE GUIDE</strong></p>\\n<p style=\\\"text-align: center;\\\"><em>Note: The shoe size is indicated in the US size range.</em></p>\\n<p><img class=\\\"size-full wp-image-124193 aligncenter\\\" src=\\\"https://example.org/wp-content/uploads/2020/09/ortorex-sandal-size-quide.jpg\\\" alt=\\\"\\\" width=\\\"600\\\" height=\\\"600\\\" /></p>\\n\", \"purchasable\": true, \"related_ids\": [87264, 9233, 13595, 93341, 4671], \"total_sales\": 128, \"date_created\": \"2020-09-28T09:34:19\", \"downloadable\": false, \"external_url\": \"\", \"manage_stock\": false, \"rating_count\": 4, \"stock_status\": \"instock\", \"bundle_layout\": \"\", \"bundled_items\": [], \"date_modified\": \"2022-01-17T13:59:53\", \"purchase_note\": \"\", \"regular_price\": \"\", \"average_rating\": \"4.25\", \"cross_sell_ids\": [], \"download_limit\": -1, \"shipping_class\": \"\", \"stock_quantity\": null, \"date_on_sale_to\": null, \"download_expiry\": -1, \"reviews_allowed\": true, \"date_created_gmt\": \"2020-09-28T08:34:19\", \"grouped_products\": [], \"low_stock_amount\": null, \"shipping_taxable\": true, \"date_modified_gmt\": \"2022-01-17T12:59:53\", \"date_on_sale_from\": null, \"shipping_class_id\": 0, \"shipping_required\": true, \"short_description\": \"\", \"sold_individually\": false, \"backorders_allowed\": false, \"catalog_visibility\": \"visible\", \"default_attributes\": [{\"id\": 17, \"name\": \"Color\", \"option\": \"sliver\"}, {\"id\": 25, \"name\": \"Shoe Size\", \"option\": \"5\"}], \"date_on_sale_to_gmt\": null, \"date_on_sale_from_gmt\": null}'),
