_by\": [], \"categories\": [{\"id\": 1452, \"name\": \"Orthopedic Footwear &amp; Clothing\", \"slug\": \"orthopedic-footwear-clothing\"}], \"dimensions\": {\"width\": \"\", \"height\": \"\", \"length\": \"\"}, \"menu_order\": 0, \"price_html\": \"<del aria-hidden=\\\"true\\\"><span class=\\\"woocommerce-Price-amount amount\\\"><bdi><span class=\\\"woocommerce-Price-currencySymbol\\\">&euro;</span>59.98</bdi></span></del> <ins><span class=\\\"woocommerce-Price-amount amount\\\"><bdi><span class=\\\"woocommerce-Price-currencySymbol\\\">&euro;</span>38.95</bdi></span></ins>\", \"sale_price\": \"\", \"tax_status\": \"taxable\", \"upsell_ids\": [], \"variations\": [87294, 87292, 87293, 87265, 87266, 87267, 87268, 87269, 87270, 87271, 87272, 87273, 87274, 87275, 87276, 87277, 87278, 87279, 87280, 87281, 87282, 87283, 87284, 87285, 87286, 87287, 87288, 87289, 87290, 87291, 87295, 87296, 87297, 87298, 87299, 87300, 87301, 87302, 87303, 87304, 87305, 87306, 87307, 87308, 87309, 87310, 87311, 87312, 87313, 87314, 87315, 87316, 87317, 87318], \"backordered\": false, \"button_text\": \"\", \"description\": \"<h3 style=\\\"text-align: center;\\\"><strong>Don\'t let foot pain stop you from enjoying the outdoors! Treat your feet to the comfort they deserve with the most stylish Orthopedic Sandals for women!</strong></h3>\\n<p><img class=\\\"size-full wp-image-86843 aligncenter\\\" src=\\\"/wp-content/uploads/2020/08/2_61628a5b-9c91-4492-a760-f3c33247ca15.gif\\\" alt=\\\"\\\" width=\\\"600\\\" height=\\\"600\\\" /></p>\\n<p>These open toe <strong>Orthopedic Correction Sandals</strong> offer an <strong>excellent combination of a classy design and comfortable support</strong>. They are <strong>specially developed with a three arch support design</strong> and <strong>a soft insole to keep your feet comfortable and healthy safe</strong> so you don’t have to choose between a sandal that’s stylish or supportive — you can have both.</p>\\n<p><img class=\\\"size-full wp-image-86847 aligncenter\\\" src=\\\"/wp-content/uploads/2020/08/giphy_large.gif\\\" alt=\\\"\\\" width=\\\"400\\\" height=\\\"400\\\" /></p>\\n<p>The sandals <strong>correct posture</strong> and <strong>eliminate muscle imbalances</strong> by moving angled toes back to its original position to improve foot and leg alignment, enhance the ease of walking and help relieve stress on the heel, ball of the foot, knees, hips, and back. They can help you <strong>avoid foot pain</strong> and <strong>protect your feet against a wide range of other complications</strong>, such as poor walking posture, plantar fasciitis, flat feet, bunions, arthritis, fallen arches, tearing tendons, ingrown toenails, and heel pressure.</p>\\n<p><img class=\\\"size-full wp-image-86863 aligncenter\\\" src=\\\"/wp-content/uploads/2020/08/ready-scaled.jpg\\\" alt=\\\"\\\" width=\\\"2560\\\" height=\\\"1710\\\" />The <strong>cushioned footbed</strong> provides <strong>comfort and support throughout a full day of walking</strong> while still allowing your feet to <strong>breathe</strong>. The strap is fully adjustable, and the low heel adds a bit of height. Soft, seam-free interior lining <strong>eliminates pressure points</strong> and friction against skin, offering <strong>a relaxed comfortable fit</strong> and <strong>durable wear</strong>.</p>\\n<p><img class=\\\"size-full wp-image-86851 aligncenter\\\" src=\\\"https://example.org/wp-content/uploads/2020/08/gbffbb-510x510-1.png\\\" alt=\\\"\\\" width=\\\"510\\\" height=\\\"510\\\" /></p>\\n<p><span class=\\\"s1\\\"><span class=\\\"s3\\\">✔️</span> <b>REDUCE PAIN </b>-  Eliminate the pain on the foot and heel caused by flat feet, poor walking posture, and plantar fasciitis.</span></p>\\n<p><span class=\\\"s1\\\"><span class=\\\"s3\\\">✔️</span> <strong>COMBAT FOOT COMPLICATIONS</strong> - Prevent multiple foot issues, such as poor walking posture, plantar fasciitis, flat feet, bunions, arthritis, fallen arches, tearing tendons, ingrown toenails, and heel pressure.</span></p>\\n<p class=\\\"p2\\\"><span class=\\\"s1\\\"><span class=\\\"s3\\\">✔️</span> <strong>SUPPORT DESIGN</strong> - Distribute the body weight evenly across the toes, arch, and ball of your feet.</span></p>\\n<p class=\\\"p2\\\"><span class=\\\"s1\\\"><span class=\\\"s3\\\">✔️</span> <strong>COMFORTABLE FIT</strong> - Premium orthotic footbed, featuring anatomical arch support, and ergonomic cushioning comfortably hug your feet, where ever you go.</span></p>\\n<p><img class=\\\"wp-image-90122 aligncenter\\\" src=\\\"https://example.org/wp-content/uploads/2020/09/1-12.jpg\\\" alt=\\\"\\\" width=\\\"736\\\" height=\\\"980\\\" /></p>\\n<p>&nbsp;</p>\\n\", \"purchasable\": true, \"related_ids\": [89934, 9233, 99774, 93341, 111714], \"total_sales\": 117, \"date_created\": \"2020-09-02T12:04:33\", \"downloadable\": false, \"external_url\": \"\", \"manage_stock\": false, \"rating_count\": 5, \"stock_status\": \"instock\", \"bundle_layout\": \"\", \"bundled_items\": [], \"date_modified\": \"2022-01-18T14:41:48\", \"purchase_note\": \"\", \"regular_price\": \"\", \"average_rating\": \"4.60\", \"cross_sell_ids\": [], \"download_limit\": -1, \"shipping_class\": \"\", \"stock_quantity\": null, \"date_on_sale_to\": null, \"download_expiry\": -1, \"reviews_allowed\": true, \"date_created_gmt\": \"2020-09-02T11:04:33\", \"grouped_products\": [], \"low_stock_amount\": null, \"shipping_taxable\": true, \"date_modified_gmt\": \"2022-01-18T13:41:48\", \"date_on_sale_from\": null, \"shipping_class_id\": 0, \"shipping_required\": true, \"short_description\": \"\", \"sold_individually\": false, \"backorders_allowed\": false, \"catalog_visibility\": \"visible\", \"default_attributes\": [{\"id\": 17, \"name\": \"Color\", \"option\": \"wine-red\"}, {\"id\": 25, \"name\": \"Shoe Size\", \"option\": \"37\"}], \"date_on_sale_to_gmt\": null, \"date_on_sale_from_gmt\": null}'),
