 \"_wpml_media_featured\", \"value\": \"0\"}, {\"id\": 2670821, \"key\": \"_wpml_media_has_media\", \"value\": \"1\"}, {\"id\": 5444847, \"key\": \"_aioseo_keywords\", \"value\": \"\"}, {\"id\": 5444850, \"key\": \"_aioseo_og_article_section\", \"value\": \"\"}, {\"id\": 5444851, \"key\": \"_aioseo_og_article_tags\", \"value\": \"\"}, {\"id\": 5631540, \"key\": \"click_counter\", \"value\": \"0\"}, {\"id\": 6614272, \"key\": \"back_total_subscribers\", \"value\": \"0\"}, {\"id\": 7238423, \"key\": \"wc_rest_api_sync_id\", \"value\": \"135608\"}], \"parent_id\": 0, \"permalink\": \"https://example.org/p/sandals-2/\", \"tax_class\": \"\", \"attributes\": [{\"id\": 17, \"name\": \"Color\", \"options\": [\"Black\", \"Bronze\", \"Golden\", \"Purple\", \"Silver\", \"Yellow\"], \"visible\": false, \"position\": 1, \"variation\": true}, {\"id\": 25, \"name\": \"Shoe Size\", \"options\": [\"5\", \"6\", \"7\", \"8\", \"9\", \"9.5\", \"10\", \"11\", \"12\"], \"visible\": false, \"position\": 2, \"variation\": true}], \"backorders\": \"no\", \"bundled_by\": [], \"categories\": [{\"id\": 1452, \"name\": \"Orthopedic Footwear &amp; Clothing\", \"slug\": \"orthopedic-footwear-clothing\"}], \"dimensions\": {\"width\": \"\", \"height\": \"\", \"length\": \"\"}, \"menu_order\": 0, \"price_html\": \"<del aria-hidden=\\\"true\\\"><span class=\\\"woocommerce-Price-amount amount\\\"><span class=\\\"woocommerce-Price-currencySymbol\\\">&#36;</span>59.98</span></del> <ins><span class=\\\"woocommerce-Price-amount amount\\\"><span class=\\\"woocommerce-Price-currencySymbol\\\">&#36;</span>29.96</span></ins>\", \"sale_price\": \"\", \"tax_status\": \"taxable\", \"upsell_ids\": [], \"variations\": [230007, 230008, 230009, 230010, 230011, 230012, 230013, 230014, 230015, 89936, 89937, 89938, 89939, 89940, 89941, 89942, 89943, 89944, 89960, 89961, 89962, 89966, 89956, 89963, 89964, 89967, 89957, 89968, 89958, 89969, 89959, 89970, 89971, 89972, 89973, 89974, 89976, 89977, 89978, 89979, 89980, 89981, 89982, 89983, 89984, 89986, 89987, 89988, 89989, 89990, 89991, 89992, 89993, 89994], \"backordered\": false, \"button_text\": \"\", \"description\": \"<h2 style=\\\"text-align: center;\\\"><strong>No more irritating bunion pain and discomfort! Ease the pain without surgery and enjoy long walks!</strong></h2>\\n<p><img class=\\\"size-full wp-image-90043 aligncenter\\\" src=\\\"https://example.org/wp-content/uploads/2020/09/b887f47d74087b8eff201d99d89e5f72.gif\\\" alt=\\\"\\\" width=\\\"580\\\" height=\\\"425\\\" /></p>\\n<p class=\\\"p1\\\">The ORTOREX™ Orthopedic Bunion Correction Sandals feature a stylish toe-ring design. The unique big toe design effectively <strong>relieves bunion pain, improves foot posture,</strong> and moves the angled toe bone back to its natural position. They are specially developed with a three arch support and a soft sole to <strong>keep your feet comfortable, healthy, and safe</strong>.</p>\\n<p class=\\\"p1\\\">Our bunion sandals help realign the skeletal system for posture correction. A weak imbalance can lead to pains in the knees, hips, and other muscles of your body. The ORTOREX™ Orthopedic Sandals help <strong>prevent hips and muscle imbalances</strong>, knock-knee and bow-leg, and other future toe complications.</p>\\n<p><img class=\\\"size-full wp-image-90039 aligncenter\\\" src=\\\"https://example.org/wp-content/uploads/2020/09/1-10.jpg\\\" alt=\\\"\\\" width=\\\"480\\\" height=\\\"411\\\" /></p>\\n<p>Three arch support design makes sure your <strong>weight is evenly distributed</strong> across the toes, arch, and ball of your feet. One of the most innovative techniques used in this pair of sandals is the <strong>sole made by</strong> <strong>nano-foam</strong> — the next generation of memory soles that will <strong>transform to fit and comfortably hug</strong> your feet, where ever you go.</p>\\n<p>The ORTOREX™ Orthopedic Bunion Correction Sandals are ideal for women suffering from bunions, flat feet, poor walking posture, and plantar fasciitis. The perfect combination of toe bunion corrector with flip flop wedge sandals allows you to hide your bunions in style. Plus, it helps <strong>prevent toe overlap and poor bunion alignment</strong>.</p>\\n<p><img class=\\\"size-full wp-image-90026 aligncenter\\\" src=\\\"https://example.org/wp-content/uploads/2020/09/19088f2b63cc5a60ef440dea27b96854.gif\\\" alt=\\\"\\\" width=\\\"590\\\" height=\\\"564\\\" /></p>\\n<p style=\\\"text-align: center;\\\"><strong>KEY BENEFITS:</strong></p>\\n<p class=\\\"p1\\\"><strong>✔️</strong> <strong>PROVIDE</strong> <strong>PAIN RELIEF</strong> — The ORTOREX™ Bunion Sandals help eliminate the pain caused by bunions, flat feet, poor walking posture, and plantar fasciitis.</p>\\n<p class=\\\"p1\\\"><strong>✔️</strong> <strong>BOAST</strong> <strong>ANTI-BUNION DESIGN</strong> — Special big toe strap relieves bunion pain, helps correct and realign them, and prevents bunions from forming.</p>\\n<p class=\\\"p1\\\"><strong>✔️</strong> <strong>PROMOTE</strong> <strong>POSTURE CORRECTION</strong> — Move the angled toe back to its natural position while realigning the skeletal system for posture correction. The sandals\' design prevents hip and muscle imbalances and fixes knock-knee and bow-leg.</p>\\n<p class=\\\"p1\\\"><strong>✔️</strong> <strong>OFFER</strong> <strong>THREE ARCH SUPPORT</strong> — The ORTOREX™ Orthopedic Sandals evenly distribute the weight across the toes, arch, and ball of your feet, making them feel more comfortable and steady.</p>\\n<p class=\\\"p1\\\"><strong>✔️</strong> <strong>SUPER COMFORTABLE</strong> — Our sandals provide ultimate comfort even while wearing all day long; they won\'t hurt your feet, toes, or ankles.</p>\\n<p style=\\\"text-align: center;\\\"><strong id=\\\"size_charts\\\">SIZE GUIDE:</strong></p>\\n<p style=\\\"text-align: center;\\\"><em>Note: The shoe size is indicated in the US size range.</em></p>\\n<p><img class=\\\"size-full wp-image-153180 aligncenter\\\" src=\\\"https://example.org/wp-content/uploads/2020/09/ortorex-sandal-size-quide.jpg\\\" alt=\\\"\\\" width=\\\"600\\\" height=\\\"600\\\" /></p>\\n\", \"purchasable\": true, \"related_ids\": [9233, 13595, 6666, 111714, 196267], \"total_sales\": 209, \"date_created\": \"2020-09-28T09:34:19\", \"downloadable\": false, \"external_url\": \"\", \"manage_stock\": false, \"rating_count\": 18, \"stock_status\": \"instock\", \"translations\": {\"de\": \"135608\", \"en\": \"89934\", \"fr\": \"141884\", \"nl\": \"148606\"}, \"bundle_layout\": \"\", \"bundled_items\": [], \"date_modified\": \"2022-03-02T19:39:30\", \"purchase_note\": \"\", \"regular_price\": \"\", \"average_rating\": \"4.83\", \"cross_sell_ids\": [], \"download_limit\": -1, \"shipping_class\": \"\", \"stock_quantity\": null, \"date_on_sale_to\": null, \"download_expiry\": -1, \"reviews_allowed\": true, \"date_created_gmt\": \"2020-09-28T08:34:19\", \"grouped_products\": [], \"low_stock_amount\": null, \"shipping_taxable\": true, \"date_modified_gmt\": \"2022-03-02T18:39:30\", \"date_on_sale_from\": null, \"shipping_class_id\": 0, \"shipping_required\": true, \"short_description\": \"\", \"sold_individually\": false, \"backorders_allowed\": false, \"catalog_visibility\": \"visible\", \"default_attributes\": [{\"id\": 17, \"name\": \"Color\", \"option\": \"sliver\"}, {\"id\": 25, \"name\": \"Shoe Size\", \"option\": \"9\"}], \"date_on_sale_to_gmt\": null, \"date_on_sale_from_gmt\": null}');
