: \"Shoe Size\", \"options\": [\"3.5\", \"4\", \"4.5\", \"5\", \"6\", \"6.5\", \"7\", \"8\", \"9\"], \"visible\": false, \"position\": 1, \"variation\": true}], \"backorders\": \"no\", \"bundled_by\": [], \"categories\": [{\"id\": 1452, \"name\": \"Orthopedic Footwear &amp; Clothing\", \"slug\": \"orthopedic-footwear-clothing\"}], \"dimensions\": {\"width\": \"\", \"height\": \"\", \"length\": \"\"}, \"menu_order\": 0, \"price_html\": \"<del aria-hidden=\\\"true\\\"><span class=\\\"woocommerce-Price-amount amount\\\"><bdi><span class=\\\"woocommerce-Price-currencySymbol\\\">&pound;</span>49.94</bdi></span></del> <ins><span class=\\\"woocommerce-Price-amount amount\\\"><bdi><span class=\\\"woocommerce-Price-currencySymbol\\\">&pound;</span>24.97</bdi></span></ins>\", \"sale_price\": \"\", \"tax_status\": \"taxable\", \"upsell_ids\": [], \"variations\": [89937, 89936, 89938, 89939, 89940, 89941, 89942, 89943, 89944, 89946, 89947, 89948, 89949, 89950, 89951, 89952, 89953, 89954, 89956, 89957, 89958, 89959, 89960, 89961, 89962, 89963, 89964, 89966, 89967, 89968, 89969, 89970, 89971, 89972, 89973, 89974, 89976, 89977, 89978, 89979, 89980, 89981, 89982, 89983, 89984, 89986, 89987, 89988, 89989, 89990, 89991, 89992, 89993, 89994], \"backordered\": false, \"button_text\": \"\", \"description\": \"<h2 style=\\\"text-align: center;\\\"><strong>No more irritating bunion pain and discomfort! Ease the pain without surgery and enjoy long walks!</strong></h2>\\n<p><img class=\\\"size-full wp-image-90043 aligncenter\\\" src=\\\"https://example.org/wp-content/uploads/2020/09/b887f47d74087b8eff201d99d89e5f72.gif\\\" alt=\\\"\\\" width=\\\"580\\\" height=\\\"425\\\" /></p>\\n<p class=\\\"p1\\\">The ORTOREX™ Orthopedic Bunion Correction Sandals feature a stylish toe-ring design. The unique big toe design effectively <strong>relieves bunion pain, improves foot posture,</strong> and moves the angled toe bone back to its natural position. They are specially developed with a three arch support and a soft sole to <strong>keep your feet comfortable, healthy, and safe</strong>.</p>\\n<p class=\\\"p1\\\">Our bunion sandals help realign the skeletal system for posture correction. A weak imbalance can lead to pains in the knees, hips, and other muscles of your body. The ORTOREX™ Orthopedic Sandals help <strong>prevent hips and muscle imbalances</strong>, knock-knee and bow-leg, and other future toe complications.</p>\\n<p><img class=\\\"size-full wp-image-90039 aligncenter\\\" src=\\\"https://example.org/wp-content/uploads/2020/09/1-10.jpg\\\" alt=\\\"\\\" width=\\\"480\\\" height=\\\"411\\\" /></p>\\n<p>The design of footbed ensures your <strong>weight is evenly distributed</strong> across the toes, arch, and ball of your feet. One of the most innovative techniques used in this pair of sandals is the <strong>sole made by</strong> <strong>nano-foam</strong> — the next generation of memory soles that will <strong>transform to fit and comfortably hug</strong> your feet, where ever you go.</p>\\n<p><img class=\\\"size-full wp-image-213682 aligncenter\\\" src=\\\"https://example.org/wp-content/uploads/2022/04/description-01-e1650057629391.png\\\" alt=\\\"\\\" width=\\\"600\\\" height=\\\"600\\\" /></p>\\n<p>The ORTOREX™ Orthopedic Bunion Correction Sandals are ideal for women suffering from bunions, flat feet, poor walking posture, and plantar fasciitis. The perfect combination of toe bunion corrector with flip flop wedge sandals allows you to hide your bunions in style. Plus, it helps <strong>prevent toe overlap and poor bunion alignment</strong>.</p>\\n<p><img class=\\\"size-full wp-image-213683 aligncenter\\\" src=\\\"https://example.org/wp-content/uploads/2022/04/description-02-e1650057642958.png\\\" alt=\\\"\\\" width=\\\"600\\\" height=\\\"600\\\" /></p>\\n<p style=\\\"text-align: center;\\\"><strong>KEY BENEFITS:</strong></p>\\n<p class=\\\"p1\\\"><strong>✔️</strong> <strong>PROVIDE</strong> <strong>PAIN RELIEF</strong> — The ORTOREX™ Bunion Sandals help eliminate the pain caused by bunions, flat feet, poor walking posture, and plantar fasciitis.</p>\\n<p class=\\\"p1\\\"><strong>✔️</strong> <strong>PREVENT</strong> <strong>BUNIONS</strong> — The pecial big toe strap relieves bunion pain, helps correct and realign them, and prevents bunions from forming.</p>\\n<p class=\\\"p1\\\"><strong>✔️</strong> <strong>PROMOTE</strong> <strong>POSTURE CORRECTION</strong> — Move the angled toe back to its natural position while realigning the skeletal system for posture correction. The sandals\' design prevents hip and muscle imbalances and fixes knock-knee and bow-leg.</p>\\n<p class=\\\"p1\\\"><strong>✔️</strong> <strong>OFFER</strong> <strong>MUCH-NEEDED SUPPORT</strong> — The ORTOREX™ Orthopedic Sandals evenly distribute the weight across the toes, arch, and ball of your feet, making them feel more comfortable and steady.</p>\\n<p class=\\\"p1\\\"><strong>✔️</strong> <strong>SUPER COMFORTABLE</strong> — Our sandals provide ultimate comfort even while wearing all day long; they won\'t hurt your feet, toes, or ankles. The sandals are made from 100% PU leather and are considered vegan.</p>\\n<p style=\\\"text-align: center;\\\"><strong id=\\\"size_charts\\\">SIZE GUIDE:</strong></p>\\n<p style=\\\"text-align: center;\\\"><em>Note: If you have wider than average feet, please choose a larger size.</em></p>\\n<p><img class=\\\"size-full wp-image-213410 aligncenter\\\" id=\\\"size\\\" src=\\\"https://example.org/wp-content/uploads/2020/09/UK-bunion-sandal-size-guide-600.png\\\" alt=\\\"\\\" width=\\\"600\\\" height=\\\"600\\\" /></p>\\n\", \"has_options\": true, \"purchasable\": true, \"related_ids\": [99774, 196267, 87264, 6666, 9233], \"total_sales\": 576, \"date_created\": \"2020-09-28T09:34:19\", \"downloadable\": false, \"external_url\": \"\", \"manage_stock\": false, \"rating_count\": 6, \"stock_status\": \"instock\", \"bundle_layout\": \"\", \"bundled_items\": [], \"date_modified\": \"2022-05-09T11:14:12\", \"purchase_note\": \"\", \"regular_price\": \"\", \"average_rating\": \"4.50\", \"cross_sell_ids\": [], \"download_limit\": -1, \"shipping_class\": \"\", \"stock_quantity\": null, \"date_on_sale_to\": null, \"download_expiry\": -1, \"reviews_allowed\": true, \"date_created_gmt\": \"2020-09-28T08:34:19\", \"grouped_products\": [], \"low_stock_amount\": null, \"shipping_taxable\": true, \"date_modified_gmt\": \"2022-05-09T10:14:12\", \"date_on_sale_from\": null, \"shipping_class_id\": 0, \"shipping_required\": true, \"short_description\": \"\", \"sold_individually\": false, \"backorders_allowed\": false, \"catalog_visibility\": \"visible\", \"default_attributes\": [{\"id\": 17, \"name\": \"Color\", \"option\": \"golden\"}, {\"id\": 25, \"name\": \"Shoe Size\", \"option\": \"9\"}], \"date_on_sale_to_gmt\": null, \"date_on_sale_from_gmt\": null}'),
