9134, \"key\": \"_aioseo_keywords\", \"value\": \"\"}, {\"id\": 4289137, \"key\": \"_aioseo_og_article_section\", \"value\": \"\"}, {\"id\": 4289138, \"key\": \"_aioseo_og_article_tags\", \"value\": \"\"}, {\"id\": 4326076, \"key\": \"back_total_subscribers\", \"value\": \"0\"}], \"parent_id\": 0, \"permalink\": \"https://example.org/p/sandals/\", \"tax_class\": \"\", \"attributes\": [{\"id\": 17, \"name\": \"Color\", \"options\": [\"Blue\", \"Brown\", \"Deep Blue\", \"Red\", \"Wine Red\", \"Black\"], \"visible\": false, \"position\": 1, \"variation\": true}, {\"id\": 25, \"name\": \"Shoe Size\", \"options\": [\"35\", \"36\", \"37\", \"38\", \"39\", \"40\", \"41\", \"42\", \"43\"], \"visible\": false, \"position\": 2, \"variation\": true}], \"backorders\": \"no\", \"bundled_by\": [], \"categories\": [{\"id\": 1452, \"name\": \"Orthopedic Footwear &amp; Clothing\", \"slug\": \"orthopedic-footwear-clothing\"}], \"dimensions\": {\"width\": \"\", \"height\": \"\", \"length\": \"\"}, \"menu_order\": 0, \"price_html\": \"<del aria-hidden=\\\"true\\\"><span class=\\\"woocommerce-Price-amount amount\\\"><bdi><span class=\\\"woocommerce-Price-currencySymbol\\\">&pound;</span>44.39</bdi></span></del> <ins><span class=\\\"woocommerce-Price-amount amount\\\"><bdi><span class=\\\"woocommerce-Price-currencySymbol\\\">&pound;</span>28.82</bdi></span></ins>\", \"sale_price\": \"\", \"tax_status\": \"taxable\", \"upsell_ids\": [], \"variations\": [87294, 87292, 87293, 87265, 87266, 87267, 87268, 87269, 87270, 87271, 87272, 87273, 87274, 87275, 87276, 87277, 87278, 87279, 87280, 87281, 87282, 87283, 87284, 87285, 87286, 87287, 87288, 87289, 87290, 87291, 87295, 87296, 87297, 87298, 87299, 87300, 87301, 87302, 87303, 87304, 87305, 87306, 87307, 87308, 87309, 87310, 87311, 87312, 87313, 87314, 87315, 87316, 87317, 87318], \"backordered\": false, \"button_text\": \"\", \"description\": \"<h2 style=\\\"text-align: center;\\\"><strong>Don’t let foot pain stop you from enjoying the outdoors! Treat your feet to the comfort they deserve!</strong></h2>\\n<p><img class=\\\"size-full wp-image-86843 aligncenter\\\" src=\\\"/wp-content/uploads/2020/08/2_61628a5b-9c91-4492-a760-f3c33247ca15.gif\\\" alt=\\\"\\\" width=\\\"600\\\" height=\\\"600\\\" /></p>\\n<p>The ORTOREX™ Orthopedic Correction Sandals offer an excellent classy design and comfortable support. They are specially developed with a<strong> three arch support </strong>design and a soft insole to<strong> keep your feet comfortable and healthy safe</strong>. You don’t have to choose between a stylish or supportive sandal — you can have both!</p>\\n<p><img class=\\\"size-full wp-image-86847 aligncenter\\\" src=\\\"/wp-content/uploads/2020/08/giphy_large.gif\\\" alt=\\\"\\\" width=\\\"400\\\" height=\\\"400\\\" /></p>\\n<p>Our orthopedic sandals <strong>correct posture</strong> and <strong>eliminate muscle imbalances</strong> by moving angled toes back to their original position. It improves foot and leg alignment, enhances the ease of walking, and helps relieve stress on the heel, ball of the foot, knees, hips, and back.</p>\\n<p><img class=\\\"aligncenter wp-image-211070 size-full\\\" src=\\\"https://example.org/wp-content/uploads/2020/09/variant-image-02.jpg\\\" alt=\\\"\\\" width=\\\"600\\\" height=\\\"600\\\" /></p>\\n<p>The ORTOREX™ Correction Sandals will help you <strong>avoid foot pain</strong> and <strong>protect your feet </strong>against a wide range of other complications, such as poor walking posture, plantar fasciitis, flat feet, bunions, arthritis, fallen arches, tearing tendons, ingrown toenails, and heel pressure.</p>\\n<p><img class=\\\"size-full wp-image-86863 aligncenter\\\" src=\\\"/wp-content/uploads/2020/08/ready-scaled.jpg\\\" alt=\\\"\\\" width=\\\"2560\\\" height=\\\"1710\\\" />The <strong>cushioned footbed</strong> provides comfort and support throughout a full day of walking while still allowing your feet to <strong>breathe</strong>. Soft, seam-free interior lining <strong>eliminates pressure points</strong> and friction against the skin, offering a relaxed, <strong>comfortable fit</strong> and <strong>durable wear</strong>. The strap is fully adjustable, and the low heel adds a bit of height.</p>\\n<p><img class=\\\"wp-image-211069 size-full aligncenter\\\" src=\\\"https://example.org/wp-content/uploads/2020/09/variant-image.jpg\\\" alt=\\\"\\\" width=\\\"600\\\" height=\\\"600\\\" /></p>\\n<p style=\\\"text-align: center;\\\"><strong>KEY BENEFITS:</strong></p>\\n<p><span class=\\\"s1\\\"><strong><span class=\\\"s3\\\">✔️</span></strong> <b>REDUCE PAIN —</b>  Eliminate the pain on the foot and heel caused by flat feet, poor walking posture, and plantar fasciitis.</span></p>\\n<p><span class=\\\"s1\\\"><strong><span class=\\\"s3\\\">✔️</span> COMBAT FOOT COMPLICATIONS</strong> — The ORTOREX™ Correction Sandals help prevent multiple foot issues, such as poor walking posture, plantar fasciitis, flat feet, bunions, arthritis, fallen arches, tearing tendons, ingrown toenails, and heel pressure.</span></p>\\n<p class=\\\"p2\\\"><span class=\\\"s1\\\"><strong><span class=\\\"s3\\\">✔️</span> BOAST</strong> <strong>SUPPORT DESIGN</strong> — Distribute the body weight evenly across the toes, arch, and ball of your feet.</span></p>\\n<p class=\\\"p2\\\"><span class=\\\"s1\\\"><strong><span class=\\\"s3\\\">✔️</span> OFFER</strong> <strong>COMFORTABLE FIT</strong> — Premium orthotic footbed, featuring anatomical arch support and ergonomic cushioning comfortably hug your feet, where ever you go.</span></p>\\n<p><img id=\\\"size_charts\\\" class=\\\"wp-image-90122 aligncenter\\\" src=\\\"https://example.org/wp-content/uploads/2020/09/1-12.jpg\\\" alt=\\\"\\\" width=\\\"736\\\" height=\\\"980\\\" /></p>\\n<p>&nbsp;</p>\\n\", \"has_options\": true, \"purchasable\": true, \"related_ids\": [9233, 196267, 215042, 13595, 245397], \"total_sales\": 1793, \"date_created\": \"2020-09-02T12:04:33\", \"downloadable\": false, \"external_url\": \"\", \"manage